-- Database filling script.

use geekbrains;

#
# TABLE STRUCTURE FOR: comments
#

DROP TABLE IF EXISTS `comments`;

CREATE TABLE `comments` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'String id',
  `user_id` int(10) unsigned NOT NULL COMMENT 'Comment author link',
  `body` text COLLATE utf8_unicode_ci NOT NULL COMMENT 'Message text',
  `target_id` int(10) unsigned NOT NULL COMMENT 'Target id',
  `target_type_id` int(10) unsigned NOT NULL COMMENT 'Target type id',
  `rating` enum('1','2','3','4','5') COLLATE utf8_unicode_ci NOT NULL COMMENT 'Target rating',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'String creation time',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'String update time',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=251 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Comments table';



#
# TABLE STRUCTURE FOR: courses
#

DROP TABLE IF EXISTS `courses`;

CREATE TABLE `courses` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'String id',
  `name` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Course name',
  `description` text COLLATE utf8_unicode_ci NOT NULL COMMENT 'Course description',
  `cost` int(11) NOT NULL COMMENT 'Course cost',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'String creation time',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'String update time',
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Courses table';



#
# TABLE STRUCTURE FOR: courses_lessons
#

DROP TABLE IF EXISTS `courses_lessons`;

CREATE TABLE `courses_lessons` (
  `course_id` int(10) unsigned NOT NULL COMMENT 'Course link',
  `lesson_id` int(10) unsigned NOT NULL COMMENT 'Lesson link',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'String creation time',
  PRIMARY KEY (`course_id`,`lesson_id`) COMMENT 'Composite primary key',
  UNIQUE KEY `lesson_id` (`lesson_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Relations of courses and lessons';



#
# TABLE STRUCTURE FOR: courses_students
#

DROP TABLE IF EXISTS `courses_students`;

CREATE TABLE `courses_students` (
  `course_id` int(10) unsigned NOT NULL COMMENT 'Course link',
  `user_id` int(10) unsigned NOT NULL COMMENT 'User link',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'String creation time',
  PRIMARY KEY (`course_id`,`user_id`) COMMENT 'Composite primary key'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Relations of courses and students';



#
# TABLE STRUCTURE FOR: lessons
#

DROP TABLE IF EXISTS `lessons`;

CREATE TABLE `lessons` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'String id',
  `name` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Lesson name',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'String creation time',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'String update time',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Lessons table';



#
# TABLE STRUCTURE FOR: lessons_media
#

DROP TABLE IF EXISTS `lessons_media`;

CREATE TABLE `lessons_media` (
  `lesson_id` int(10) unsigned NOT NULL COMMENT 'Lesson link',
  `media_id` int(10) unsigned NOT NULL COMMENT 'Mediafile link',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'String creation time',
  PRIMARY KEY (`lesson_id`,`media_id`) COMMENT 'Composite primary key',
  UNIQUE KEY `media_id` (`media_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Relations of lessons and mediafiles';



#
# TABLE STRUCTURE FOR: media
#

DROP TABLE IF EXISTS `media`;

CREATE TABLE `media` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'String id',
  `filename` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Link to file',
  `size` int(11) NOT NULL COMMENT 'File size',
  `media_type_id` int(10) unsigned NOT NULL COMMENT 'Content type link',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'String creation time',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Mediafiles table';



#
# TABLE STRUCTURE FOR: media_types
#

DROP TABLE IF EXISTS `media_types`;

CREATE TABLE `media_types` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'String id',
  `name` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Mediatype name',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'String creation time',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'String update time',
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Mediafile types table';



#
# TABLE STRUCTURE FOR: messages
#

DROP TABLE IF EXISTS `messages`;

CREATE TABLE `messages` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'String id',
  `from_user_id` int(10) unsigned NOT NULL COMMENT 'Link to message sender',
  `to_user_id` int(10) unsigned NOT NULL COMMENT 'Link to message receiver',
  `body` text COLLATE utf8_unicode_ci NOT NULL COMMENT 'Message text',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'String creation time',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Messages table';



#
# TABLE STRUCTURE FOR: profiles
#

DROP TABLE IF EXISTS `profiles`;

CREATE TABLE `profiles` (
  `user_id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'String id',
  `gender` enum('M','F') COLLATE utf8_unicode_ci NOT NULL COMMENT 'Gender',
  `birthday` date DEFAULT NULL COMMENT 'Date of birthday',
  `country` varchar(120) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Country of Residence',
  `city` varchar(120) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'City of Residence',
  `about` text COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'User info',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'String creation time',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'String update time',
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Profiles table';



#
# TABLE STRUCTURE FOR: target_types
#

DROP TABLE IF EXISTS `target_types`;

CREATE TABLE `target_types` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'String id',
  `name` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Target name',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'String creation time',
  PRIMARY KEY (`id`),
  UNIQUE KEY `name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Target types table';



#
# TABLE STRUCTURE FOR: users
#

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'String id',
  `first_name` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'User first_name',
  `last_name` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'User last_name',
  `email` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'e-mail',
  `phone` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'phone',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'String creation time',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'String update time',
  PRIMARY KEY (`id`),
  UNIQUE KEY `email` (`email`),
  UNIQUE KEY `phone` (`phone`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Users table';



